import (
	context "context"
	fern "github.com/content-type/fern"
	fernclient "github.com/content-type/fern/client"
)

client := fernclient.NewClient()
err := client.Service.Patch(
	context.TODO(),
	&fern.PatchProxyRequest{
		Application: fern.String(
			"application",
		),
		RequireAuth: fern.Bool(
			true,
		),
	},
)

